import React from "react";

function ExpenseStatistic(props) {
  var sum = 0;
  const month = props.data.map((value) => {
    return value.date.slice(5, 7);
  });

  const sumAmount = props.data.map((value) => {
    return parseFloat(value.amount)
  })
  
